import "./SearchForm.css";

const SearchForm = (props) => {
  return (
    <div className="searchContainer">
      <label className="form-label">
        Is It Worth Watching
      </label>
      
      <div className="input-group mb-3">
        
        <input type="text" clasName="form-control" placeholder="Movie Name.." aria-label="Movie Name.." aria-describedby="button-addon2" />
        <button className="submitButton" type="button" id="button-addon2" onClick={props.handler}>Check</button>
        </div>
      
      
    </div>
  );
};

export default SearchForm;
